        </div>

        <v-row v-if="checklist.length > 0 || search || checkListStatus">
          <v-col cols="12" md="5">
            <h2>Contract Schedules</h2>
          </v-col>
          <v-col cols="12" md="7" class="d-flex align-center">
            <v-select
              flat
              solo
              background-color="var(--secondary-color)"
              class="radius-7 sorting mr-3 custom-select-small"
              append-icon="mdi-chevron-down"
              hide-details
              v-model="selectedYear"
              :items="years"
            ></v-select>
            <v-select
              flat
              solo
              background-color="var(--secondary-color)"
              class="radius-7 sorting mr-3 custom-select-small"
              append-icon="mdi-chevron-down"
              hide-details
              v-model="checkListStatus"
              :items="['Active', 'Fall Through', 'Closed']"
            >
            </v-select>
            <v-select
              flat
              solo
              background-color="var(--secondary-color)"
              class="radius-7 sorting mr-3 custom-select-small"
              hide-details
              append-icon="mdi-chevron-down"
              v-model="sorting.sortDirection"
              :items="['Ascending', 'Descending']"
            >
            </v-select>
            <v-text-field
              solo
              flat
              background-color="var(--secondary-color)"
              class="radius-7"
              hide-details
              v-model="search"
              @input="fetchdata"
              placeholder="Search contract schedule"
            >
              <template v-slot:prepend-inner>
                <v-img src="/images/search.svg" class="px-3" contain></v-img>
              </template>
            </v-text-field>
          </v-col>
        </v-row>
        <v-row v-if="checklist.length > 0" class="mt-5">
          <v-col
            cols="12"
            sm="6"
            md="4"
            lg="3"
            class="position-relative"
            v-for="item in checklist"
            :key="item.contractScheduleId"
          >
            <!-- Dots Menu (only if conditions met and percentage is not 100%) -->
            <div
              class="dots-menu"
              v-if="
                (item.organizationID == getOrganizationId &&
                  getRolePermissions == 'own') ||
                (!skipPayment && getUserId == item.createdById)
              "
            >
              <v-menu left offset-y max-width="150">
                <template v-slot:activator="{ on, attrs }">
                  <v-icon
                    :style="{
                      color: item.orgnizationColor
                        ? item.orgnizationColor
                        : 'var(--primary-color)',
                    }"
                    v-bind="attrs"
                    v-on="on"
                    style="font-size: 30px"
                    >mdi-dots-horizontal-circle</v-icon
                  >
                </template>
                <v-list class="py-0">
                  <v-list-item
                    v-if="item.checklistStatus === 'Active'"
                    class="px-2"
                    :to="`/checklist/editcontract?contractId=${item.contractScheduleId}&organizationId=${item.organizationID}`"
                  >
                    <v-list-item-title
                      class="aliceblue--text text-center font-weight-600 cursor-pointer"
                    >
                      <div class="d-flex align-center">
                        <v-icon
                          class="pr-2"
                          style="font-size: 20px"
                          :style="{
                            color:
                              item.orgnizationColor || 'var(--primary-color)',
                          }"
                          >mdi-square-edit-outline</v-icon
                        >
                        <span
                          :style="{
                            color:
                              item.orgnizationColor || 'var(--primary-color)',
                          }"
                          >Edit</span
                        >
                      </div>
                    </v-list-item-title>
                  </v-list-item>
                  <v-list-item class="px-2" @click="moveTo(item)">
                    <v-list-item-title
                      class="aliceblue--text text-center font-weight-600 cursor-pointer"
                    >
                      <div class="d-flex align-center">
                        <v-icon
                          class="pr-2"
                          style="font-size: 20px"
                          :style="{
                            color:
                              item.orgnizationColor || 'var(--primary-color)',
                          }"
                          >mdi-swap-vertical-bold</v-icon
                        >
                        <span
                          :style="{
                            color:
                              item.orgnizationColor || 'var(--primary-color)',
                          }"
                          >Move to</span
                        >
                      </div>
                    </v-list-item-title>
                  </v-list-item>
                  <v-list-item class="px-2" @click="deleteItem(item)">
                    <v-list-item-title
                      class="aliceblue--text text-center font-weight-600 cursor-pointer"
                    >
                      <div class="d-flex align-center">
                        <v-icon
                          class="pr-2"
                          style="font-size: 20px"
                          :style="{
                            color:
                              item.orgnizationColor || 'var(--primary-color)',
                          }"
                          >mdi-delete-outline</v-icon
                        >
                        <span
                          :style="{
                            color:
                              item.orgnizationColor || 'var(--primary-color)',
                          }"
                          >Delete</span
                        >
                      </div>
                    </v-list-item-title>
                  </v-list-item>
                </v-list>
              </v-menu>
            </div>

            <!-- Red and Yellow Dot Logic -->
            <div
              v-if="
                isStartDateToday(item.startDate) &&
                !isEndDatePassed(item.endDate) &&
                item.status !== 100
              "
              class="start-date-dot"
            ></div>
            <div
              v-if="isEndDatePassed(item.endDate) && item.status !== 100"
              class="end-date-dot"
            ></div>

            <!-- Contract Card -->
            <v-card
              width="350"
              :color="rgbToRgba(item.orgnizationColor, '16%')"
              class="pb-0 pt-5 mb-13 radius-21 cursor-pointer custom-card-corners"
              flat
              :to="`/checklist/user?contractId=${item.contractScheduleId}&organizationId=${item.organizationID}`"
              height="205"
            >
              <div class="d-flex align-center flex-column" style="height: 100%">
                <h5
                  class="text-center font-20 font-weight-600 px-2 handler-text-overflow"
                  :style="{
                    color: item.orgnizationColor
                      ? item.orgnizationColor
                      : 'var(--primary-color)',
                  }"
                >
                  {{ item.propertyAddressName }}
                </h5>
                <v-progress-circular
                  rotate="-90"
                  :size="90"
                  :width="13"
                  :color="item.orgnizationColor || 'var(--primary-color)'"
                  :value="
                    item.status ? item.status : item.contractTaskPercentage || 0
                  "
                  class="py-2"
                >
                  <span class="black--text font-weight-600">
                    {{
                      item.status
                        ? item.status
                        : item.contractTaskPercentage || 0
                    }}%
                  </span>
                </v-progress-circular>
              </div>
              <div style="background-color: #ffffff" class="py-3 elevation-2">
                <div class="text-center font-14 font-weight-600">
                  {{ item.organizationName || "\u00A0" }}
                </div>
              </div>
            </v-card>
          </v-col>
        </v-row>

        <div class="add-icon cursor-pointer" @click="addChecklist">
          <v-icon>mdi-plus-circle</v-icon>
        </div>
      </div>
      <div
        class="default-view font-28 font-weight-600"
        style="color: var(--primary-color)"
        v-if="
          checklist.length === 0 &&
          (search || checkListStatus) &&
          loader == false
        "
      >
        No Records Found
      </div>
      <div
        class="d-flex justify-space-between align-center mb-14 mt-6"
        v-if="checklist.length > 0"
      >
        <div>
          <span class="font-14" style="color: var(--primary-color) !important"
            >Showing 1-{{ pagination.footerValue }} of
            {{ pagination.totalCount }} entries</span
          >
        </div>
        <div class="d-flex align-center">
          <span
            class="font-14 mr-5"
            style="color: var(--primary-color) !important"
            >Entries per page:</span
          >
          <v-select
            v-model="pagination.footerValue"
            :items="[8, 16, 32, 64]"
            dense
            class="footer-select"
            hide-details
          >
          </v-select>
          <v-pagination
            v-model="pagination.page"
            :length="pagination.totalPages"
            color="var(--primary-color)"
            @input="fetchdata"
            :total-visible="7"
          ></v-pagination>
        </div>
      </div>
    </div>
    <v-dialog v-model="paymentDialog" max-width="500" persistent>
      <v-card class="pa-6 radius-21">
        <paymentcomponent @close="close" />
      </v-card>
    </v-dialog>
    <v-dialog v-model="deleteDialog" persistent max-width="400">
      <v-card class="pa-6 radius-21">
        <div class="d-flex justify-end">
          <v-icon
            @click="deleteDialog = false"
            :color="deleteColor || 'var(--primary-color)'"
            style="font-size: 33px"
            >mdi-close-circle</v-icon
          >
        </div>
        <div class="d-flex justify-center">
          <deletesvgcomponent :deleteColor="deleteColor" />
        </div>
        <h3
          :style="{ color: deleteColor || 'var(--primary-color)' }"
          class="font-weight-500 text-center"
        >
          Are you sure?
        </h3>
        <h6
          :style="{ color: deleteColor || 'var(--primary-color)' }"
          class="text-center font-weight-500"
        >
          Delete this contract schedule
        </h6>
        <v-row class="my-4">
          <v-col cols="12" md="6">
            <v-btn
              class="py-6 w-100 radius-25"
              :color="deleteColor || 'var(--primary-color)'"
              @click="close()"
              ><span class="text-transform font-18 white--text">Cancel</span>
            </v-btn>
          </v-col>
          <v-col cols="12" md="6">
            <v-btn
              class="py-6 w-100 radius-25"
              :color="deleteColor || 'var(--primary-color)'"
              @click="deleteContract"
              ><span class="text-transform font-18 white--text">Delete</span>
            </v-btn>
          </v-col>
        </v-row>
      </v-card>
    </v-dialog>
    <v-dialog v-model="moveToDialog" persistent max-width="400">
      <v-card class="pa-6 radius-21">
        <div class="d-flex justify-end">
          <v-icon
            @click="close()"
            :color="deleteColor || 'var(--primary-color)'"
            style="font-size: 33px"
            >mdi-close-circle</v-icon
          >
        </div>
        <h4
          :style="{ color: deleteColor || 'var(--primary-color)' }"
          class="font-weight-500 text-center mt-3"
        >
          Move this contract schedule to
        </h4>
        <v-btn
          class="py-6 w-100 radius-25 mt-5 mb-2"
          :color="deleteColor || 'var(--primary-color)'"
          @click="moveContractTo('Active')"
          v-if="moveToContractData?.checklistStatus !== 'Active'"
          ><span class="text-transform font-18 white--text">Active</span>
        </v-btn>
        <v-btn
          class="py-6 w-100 radius-25 mt-5"
          :color="deleteColor || 'var(--primary-color)'"
          @click="moveContractTo('Closed')"
          v-if="moveToContractData?.checklistStatus === 'Active'"
          ><span class="text-transform font-18 white--text">Closed</span>
        </v-btn>
        <v-btn
          class="py-6 w-100 radius-25 mt-5 mb-2"
          :color="deleteColor || 'var(--primary-color)'"
          @click="moveContractTo('Fall Through')"
          v-if="moveToContractData?.checklistStatus === 'Active'"
          ><span class="text-transform font-18 white--text">Fall Through</span>
        </v-btn>
      </v-card>
    </v-dialog>
  </div>
</template>

<script>
import paymentcomponent from "@/components/Checklist/payment.component.vue";
import deletesvgcomponent from "@/components/Deletesvg/delete.component.vue";
import { mapGetters } from "vuex";
export default {
  components: { paymentcomponent, deletesvgcomponent },
  data() {
    return {
      selectedYear: null,
      years: [],
      deleteDialog: false,
      editDialog: false,
      paymentDialog: false,
      moveToDialog: false,
      loader: false,
      pagination: {
        page: 1,
        footerValue: 8,
        totalPages: null,
        totalCount: null,
      },
      sorting: {
        sortBy: "",
        sortDirection: "Ascending",
      },

      search: "",
      checklist: [],
      skipPayment: null,
      payload: null,
      deleteId: "",
      deleteColor: "",
      checkListStatus: "Active",
      moveToContractId: null,
      moveToContractData: null,
    };
  },
  created() {
    const currentYear = new Date().getFullYear();
    this.years = Array.from({ length: 9 }, (_, index) => currentYear - index);
    this.selectedYear = currentYear; // Pre-select the current year
  },
  mounted() {
    this.skipPayment = localStorage.getItem("skipPayment");
    this.fetchdata();
  },
  watch: {
    "pagination.footerValue": {
      immediate: true,
      handler(newValue, oldValue) {
        if (this.checklist.length > 0) {
          if (newValue !== oldValue && this.pagination.page > 1) {
            this.pagination.page = 1;
          }
          this.fetchdata();
        }
      },
    },
    "sorting.sortDirection": {
      immediate: true,
      handler(newValue, oldValue) {
        if (this.checklist.length > 0 && newValue !== oldValue)
          this.fetchdata();
      },
    },
    selectedYear: {
      immediate: true,
      handler(newValue, oldValue) {
        if (newValue !== oldValue) {
          this.fetchdata();
        }
      },
    },
    checkListStatus: {
      immediate: true,
      handler(newValue, oldValue) {
        if (newValue !== "Active" || (oldValue && oldValue != newValue)) {
          this.fetchdata();
        }
      },
    },
    getOrganizationId: {
      immediate: true,
      handler(newValue, oldValue) {
        if (oldValue && oldValue !== newValue) {
          this.fetchdata();
          this.close();
        }
      },
    },
  },
  computed: {
    ...mapGetters([
      "getUserId",
      "getChecklistByBroker",
      "getOrganizationId",
      "getContractByUser",
      "getRolePermissions",
    ]),
  },
  methods: {
    moveContractTo(status) {
      this.loader = true;
      let payload = {
        CheckListStatus: status,
        ContractId: this.moveToContractId,
      };
      this.$store.dispatch("saveChecklistStatus", payload).then((response) => {
        if (response.data.succeeded === true) {
          this.loader = false;
          this.$swal.fire({
            position: "top-end",
            icon: "success",
            title: `Contract schedule moved successfully to ${status}`,
            showConfirmButton: false,
            timer: 2000,
            toast: true,
          });
          this.close();
          this.fetchdata();
        } else {
          this.loader = false;
          this.$swal.fire({
            position: "top-end",
            icon: "error",
            title: response.data.message,
            showConfirmButton: false,
            timer: 2000,
            toast: true,
          });
        }
      });
    },
    moveTo(item) {
      this.moveToContractData = item;
      this.moveToContractId = item.contractScheduleId;
      this.moveToDialog = true;
    },
    rgbToRgba(color, alpha) {
      if (!color || color == "var(--primary-color)" || color == "#1ba8bb") {
        // Fallback to a default color if the color is undefined or null
        return `#E1F2FF !important`; // Default to black with the given alpha
      }

      const match = color.match(/\d+/g);
      if (!match || match.length < 3) {
        // Fallback if the color does not match the expected RGB format
        return `rgba(0, 0, 0, ${alpha}) !important`;
      }

      let [r, g, b] = match.map(Number);
      return `rgba(${r}, ${g}, ${b}, ${alpha}) !important`;
    },
    deleteContract() {
      this.loader = true;
      this.$store
        .dispatch("deleteContractScheduled", this.deleteId)
        .then((response) => {
          if (response.data.succeeded === true) {
            this.loader = false;
            this.$swal.fire({
              position: "top-end",
              icon: "success",
              title: "Contract deleted successfully",
              showConfirmButton: false,
              timer: 2000,
              toast: true,
            });
            this.close();
            this.fetchdata();
          } else {
            this.loader = false;
            this.$swal.fire({
              position: "top-end",
              icon: "error",
              title: response.data.message,
              showConfirmButton: false,
              timer: 2000,
              toast: true,
            });
          }
        });
    },
    deleteItem(item) {
      this.deleteDialog = true;
      this.deleteId = item.contractScheduleId;
      this.deleteColor = item.orgnizationColor;
    },
    addChecklist() {
      if (!this.skipPayment && this.getOrganizationId) {
        this.$router.push("/checklist/contract");
      } else {
        this.paymentDialog = true;
      }
    },
    // Check if the start date is equal to today's date
    isStartDateToday(date) {
      const today = new Date();
      const startDate = new Date(date);
      // Set the time portion to midnight for accurate comparison
      today.setHours(0, 0, 0, 0);
      startDate.setHours(0, 0, 0, 0);
      return startDate.getTime() === today.getTime();
    },

    // Check if the end date has passed
    isEndDatePassed(date) {
      const today = new Date();
      return new Date(date) < today;
    },

    // Fetch data from the API
    fetchdata() {
      this.loader = true;
      this.payload = {
        userId: this.getUserId,
        isPagination: true,
        size: this.pagination.footerValue,
        pageNo: this.pagination.page,
        sortBy: this.sorting.sortBy,
        sortDirection:
          this.sorting.sortDirection === "Ascending" ? "ASC" : "DESC",
        checkListStatus: this.checkListStatus,
        year: this.selectedYear.toString(),
      };
      if (this.getRolePermissions == "own") {
        this.payload.organizationId = this.getOrganizationId;
      }
      if (this.search) {
        this.payload = {
          search: this.search.trim(),
          userId: this.getUserId,
          isPagination: false,
          sortBy: this.sorting.sortBy,
          sortDirection:
            this.sorting.sortDirection === "Ascending" ? "ASC" : "DESC",
          checkListStatus: this.checkListStatus,
        };
        if (this.pagination.page > 1) {
          this.pagination.page = 1;
        }
        if (this.getRolePermissions == "own") {
          this.payload.organizationId = this.getOrganizationId;
        }
      }
      this.$store
        .dispatch("getContractByUser", this.payload)
        .then((response) => {
          this.loader = false;
          this.checklist = this.getContractByUser
            ? this.getContractByUser.contractScheduleList
            : [];
          if (this.checklist.length === 0 && this.pagination.page > 1) {
            this.pagination.page = 1;
            this.fetchdata();
          }
          this.pagination.totalCount = response.data.totalCounts;
          this.pagination.totalPages = this.search
            ? 1
            : Math.ceil(
                this.pagination.totalCount / this.pagination.footerValue
              );
        });
    },
    dotsDialog(item) {
      if (item === "Edit") {
        this.editDialog = true;
      } else {
        this.deleteDialog = true;
      }
    },
    close() {
      this.editDialog = false;
      this.deleteDialog = false;
      this.paymentDialog = false;
      this.moveToDialog = false;
    },
  },
};
</script>

